# Viloyatlar bo'yicha guruhlash
grouped = defaultdict(lambda: {"kod": "", "childs": []})

for item in data:
    viloyat = item["viloyat"]
    if not grouped[viloyat]["kod"]:
        grouped[viloyat]["kod"] = item["viloyatkod"]
    grouped[viloyat]["childs"].append({
        "tuman": item["tuman"],
        "tumankod": item["tumankod"]
    })

# Yakuniy natijani listga aylantirish
result = []
for viloyat, details in grouped.items():
    result.append({
        "viloyat": viloyat,
        "kod": details["kod"],
        "childs": details["childs"]
    })

# Natijani chiroyli ko‘rinishda chop qilish (ixtiyoriy)
print(json.dumps(result, ensure_ascii=False, indent=2))
# Natijani faylga JSON formatida saqlash
with open("hududlar.json", "w", encoding="utf-8") as f:
    json.dump(result, f, ensure_ascii=False, indent=2)